INSERT INTO `blogs` (`id`, `title`, `short_description`, `long_description`, `image`, `slug`, `is_sticky`, `comment_enable`, `comments`, `views`, `likes`, `seo_title`, `meta_key`, `meta_description`, `created_by`, `modified_by`, `status`, `created_at`, `updated_at`) VALUES
(1, 'How do I make a website SEO friendly?', 'There are so many factors when it comes to SEO it hard to keep track and optimize for all of them. Consider using SEO Tools to monitor your website and check up on various aspects of it.', '<p><strong>SEO Basics &mdash; Figuring Out the Right Keywords</strong></p>\r\n\r\n<p>We&rsquo;ve talked about keywords being important. But you can&rsquo;t just come up with them out of the blue. If you optimize for the wrong keywords, even if they are related to your niche, all your efforts will be for nothing. You need to figure out how exactly people are searching for information and tailor your keywords for your website to that&hellip; this should also influence the topics of blog posts and other content.</p>\r\n\r\n<p>It&rsquo;s important to use a keyword planner tool to do some serious research of the right keywords to optimize for. Of all the SEO basics, this is where you should start. As having the right keywords will guide all your other optimization efforts.</p>\r\n\r\n<p>Google itself has an effective tool here:&nbsp;<a class=\"external_link\" href=\"https://adwords.google.com/home/tools/keyword-planner/\" rel=\"noopener nofollow\" style=\"background: url(&quot;//qsf.fs.quoracdn.net/-3-images.new_grid.external_link.svg-26-7f84ed22dfd7e97b.svg&quot;) right 0.3em / 10.5px no-repeat; text-decoration-line: none; color: rgb(43, 109, 173); padding-right: 15px;\" target=\"_blank\">https://adwords.google.com/home/...</a></p>\r\n\r\n<p>Let&rsquo;s look at an example.</p>\r\n\r\n<p>Say your niche is yoga. The keyword &ldquo;yoga beginners&rdquo; results in just 1,000 to 10,000 searches per month in the U.S, but &ldquo;yoga for beginners&rdquo; has 10,000 to 100,000. Can you see what keyword you should be optimizing for?</p>\r\n\r\n<p>Another example. If you&rsquo;re providing a treatment for back pain, the search term &ldquo;lower back pain relief&rdquo; has 10,000 to 100,000 searches per month, but &ldquo;back pain treatment&rdquo; only has 1,000 to 10,000.</p>\r\n\r\n<p>These two examples show how people search for information and products in each niche. And the keywords you pick for your SEO efforts should reflect that. Remember that this research should also guide the content your provide.</p>', 'next-page_seo.jpg', 'how-do-i-make-a-website-seo-friendly', 0, 0, 0, 536, 0, NULL, NULL, NULL, 1, NULL, 1, '2018-12-14 00:24:03', '2024-01-15 19:15:31'),
(2, 'How do I speed up a WordPress website?', 'Build, test and deploy something new. Free for 60 days.\r\nTry our optimized plans with dedicated hyper-threads on best-in-class CPUs, now with more RAM and SSD.\r\nLearn more at try.digitalocean.com', '<ol style=\"margin-left:0px; margin-right:2em\">\r\n	<li>use caching like W3 total cache.</li>\r\n	<li>Remove unused plugins. Every plugin hooks into the loop &mdash; a series events that start with loading up dependencies to connecting to the database to making calls (<em>some</em>&nbsp;to the database, some to third parties, some doing calculations)&hellip; all depending on what a given plugin is doing. Concluding in sending the buffered output to the requesting browser.</li>\r\n	<li>optimize your images (make sure they aren&rsquo;t huge) &hellip; using the developer console in your web browser &hellip; flip over to the network tab. Hard refresh with cache disabled and see what&rsquo;s taking so long to load. That&rsquo;s goig. To be your best indicator of what&rsquo;s causing your site to feel slow outside of the page just being slow to compile during the loop.</li>\r\n	<li>offload things to a CDN (also configurable in #1).</li>\r\n	<li>disable plugins one by one if your server response time sucks (long time during the loop). That approach can identify a specific culprit to evaluate further.</li>\r\n	<li>hire someone to code-review the poorly performing plugins. Or, if you&rsquo;re brave &hellip; do it yourself using tools like XHprof or new relic APM.</li>\r\n	<li>get off WordPress &mdash; or any dynamic content management system for that matter. Imagine if every time you you wanted to go to the store you had to have a brand new car built for you. That&rsquo;s how every request in WordPress works. Every request is new, every request requires class construction, connections, iterating through internal loops &hellip; etc. it is painfully slow. If you can instead create a static site (built once, read many times) then it&rsquo;s very fast. That would be done using an HTML template (think Theme), some content files, and a command-line tool called Jekyll. There are of course downsides to this approach and doesn&rsquo;t fit most use-cases&hellip; but if maximum performance is the name, then static sites are the game.</li>\r\n</ol>', 'next-page_page_speed.jpg', 'how-do-i-speed-up-a-wordpress-website', 0, 0, 0, 570, 0, NULL, NULL, NULL, 1, NULL, 1, '2018-12-14 00:29:33', '2024-01-15 21:42:40'),
(3, 'How do I improve the SEO ranking of a website?', '7 Ways To Improve SEO Rankings [2018] and Drive Massive Traffic To Your Site', '<p><strong>7 Ways To Improve SEO Rankings [2018] and Drive Massive Traffic To Your Site</strong></p>\r\n\r\n<p><strong><em>Create Quality Content</em></strong></p>\r\n\r\n<p>SEO is actually all about content marketing.</p>\r\n\r\n<p>Make sure your content is useful, relevant and high quality, in a user-friendly language. Use right keyword targeting, add relevantly and quality outbound links. If your content is not boring and users keep coming back to your website, then you will notice a rise in page views and your chances of better ranking will go higher.</p>\r\n\r\n<p>Publish original content only; avoid using duplicate content from your site or any other website. The Google search architecture is strict about this.</p>\r\n\r\n<p>Continuously update your content; add new and relevant content consistently to your site. It is one of the best indicators of your site&#39;s relevancy for both the search engines and the users. Updating content at regular intervals helps to keep your site ranking at the top.</p>\r\n\r\n<p><strong><em>Optimise metadata</em></strong></p>\r\n\r\n<p>Meta tags are snippets of text that describe a page&rsquo;s content; the meta tags don&rsquo;t appear on the page itself, but only in the page&rsquo;s code. In other words, they provide data about your page to search engines and website visitors</p>\r\n\r\n<p>An effective and high-quality SEO site description &amp; information in your meta-tags helps in a great way to rank better in search engines.</p>\r\n\r\n<p><strong><em>Structure H1 &amp; headings tags</em></strong></p>\r\n\r\n<p>It is highly recommended to use only one H1 tag on a single web page that improves search rankings and makes easy to crawl fast. Still, you can use other header tags H2, H3, .., H6 several times.</p>\r\n\r\n<p>Include relevant terms, add keywords, make useful and informative titles, and use them in a proper way in your header tags. This will attract your readers to go deep in your content details and results in getting a low bounce rate for your web page.</p>\r\n\r\n<p><strong><em>Optimise images &amp; multimedia</em></strong></p>\r\n\r\n<p>It&rsquo;s not just about the size and format of your images. Use relevant keywords for your image title, alt tag, and description; this will help search engines to understand your media better and rank them for relevant searches.</p>\r\n\r\n<p>Use videos, infographics, charts, and other multimedia content to make your web page look attractive.</p>\r\n\r\n<p><strong><em>Improve your page loading speed</em></strong></p>\r\n\r\n<p>According to Google, a website can lose as many as half its visitors while loading. This means you want to keep load times short and sweet to maximize user experience.</p>\r\n\r\n<p><strong><em>Encourage sharing on social media</em></strong></p>\r\n\r\n<p>You can get your website&rsquo;s SEO ranking improved if people share links to your website on social media. Various web-based platforms, technologies, and applications enable users to socially interact with other users online. It includes Facebook, Twitter, YouTube, Pinterest, etc. social media platforms.</p>\r\n\r\n<p><strong><em>Optimise your site for mobile devices</em></strong></p>\r\n\r\n<p>Is your site optimised for mobile devices? Mobile use is on the rise. The world has quickly shifted from favoring online experiences on desktop devices to mostly preferring mobile engagements; roughly 57 percent of all internet traffic [1] now comes from smartphones and tablets.</p>\r\n\r\n<p>If you aren&rsquo;t focusing on appealing to that audience, you could be missing out on 57 percent of your potential conversion opportunities.</p>\r\n\r\n<p>Clearly, Google recognises this and ranks sites accordingly.</p>\r\n\r\n<p><strong><em>Follow the above-mentioned tips and increase your Google search ranking free &amp; fast.</em></strong></p>', 'next-page-seo_ranking_of_a_website.png', 'how-do-i-improve-the-seo-ranking-of-a-website', 0, 0, 0, 542, 0, NULL, NULL, NULL, 1, NULL, 1, '2018-12-14 00:35:10', '2024-01-15 19:32:41'),
(4, 'What is the fastest front-end framework?', 'So as of 2016, at that time, of those limited choices, here is the ranking:\r\n\r\nElm\r\nAngular 2\r\nAngular 1.5\r\nEmber\r\nReact', '<p>So as of 2016, at that time, of those limited choices, here is the ranking:</p>\r\n\r\n<ol>\r\n	<li>Elm</li>\r\n	<li>Angular 2</li>\r\n	<li>Angular 1.5</li>\r\n	<li>Ember</li>\r\n	<li>React</li>\r\n</ol>\r\n\r\n<p><strong>For 2017,&nbsp;</strong><a class=\"external_link\" href=\"http://www.stefankrause.net/wp/?p=431\" rel=\"noopener nofollow\" style=\"background: url(&quot;//qsf.fs.quoracdn.net/-3-images.new_grid.external_link.svg-26-7f84ed22dfd7e97b.svg&quot;) right 0.3em / 10.5px no-repeat; text-decoration-line: none; color: rgb(43, 109, 173); padding-right: 15px;\" target=\"_blank\"><strong>Stefan Krause has been running rounds of benchmarks for various frontend web frameworks</strong></a><strong>. You can view the results here:&nbsp;</strong><a class=\"external_link\" href=\"http://www.stefankrause.net/js-frameworks-benchmark6/webdriver-ts-results/table.html\" rel=\"noopener nofollow\" style=\"background: url(&quot;//qsf.fs.quoracdn.net/-3-images.new_grid.external_link.svg-26-7f84ed22dfd7e97b.svg&quot;) right 0.3em / 10.5px no-repeat; text-decoration-line: none; color: rgb(43, 109, 173); padding-right: 15px;\" target=\"_blank\"><strong>Interactive Results</strong></a></p>\r\n\r\n<p><em>You can play with which frameworks appear in that benchmark and see what the results are.</em></p>\r\n\r\n<p>For example, for the swapping rows benchmark, the results were:</p>\r\n\r\n<ol>\r\n	<li>kivi and vanilla js (tie)</li>\r\n	<li>surplus</li>\r\n	<li>inferno</li>\r\n	<li>ivi</li>\r\n	<li>bobril</li>\r\n</ol>\r\n\r\n<p>Selecting the same frameworks as above (ember, react, angular 2, angularjs 1.x, elm) has this result:</p>\r\n\r\n<ol style=\"margin-left:0px; margin-right:2em\">\r\n	<li>angular 4</li>\r\n	<li>angular 2</li>\r\n	<li>react 15</li>\r\n	<li>angularjs 1.x</li>\r\n	<li>ember 2.15</li>\r\n	<li>elm 0.18</li>\r\n</ol>', 'next-page-seo_ranking_of_a_website.png', 'what-is-the-fastest-front-end-framework', 0, 0, 0, 729, 0, NULL, NULL, NULL, 1, NULL, 1, '2018-12-14 00:41:54', '2024-01-15 18:21:52'),
(8, 'What is the coolest / most clever website', NULL, '<p>Glad you asked, but my clever video programming application is not yet available on the web.</p>\r\n\r\n<p>How cool is it, you ask? Well, for one thing you can navigate through it with simple keystrokes; you can intuitively sort and drill down video search results; you can scroll through video frames or play them at different playback rates in&nbsp;<em>reverse and forward</em>&nbsp;&mdash;&nbsp;<strong>even on an iPad&nbsp;</strong>&mdash; with the most clever tool I devised so far for the task at hand; you can&nbsp;<em>zoom and pan</em>&nbsp;any video or any video frame with keyboard, mouse, or touch; you can create, collect, edit, and save video meta data effortlessly and&nbsp;<em>encrypt</em>&nbsp;all the data for private usage and sharing; and you can do lots more and all this&nbsp;<em>without having to log into any YouTube account!</em></p>', 'main-qimg-81b4cecc54acbbeedd650b930c41a6f1.jpg', 'what-is-the-coolest-most-clever-websiteapplication-youve-seen-in-the-last-3-months', 0, 0, 0, 838, 0, NULL, NULL, NULL, 1, 1, 1, '2018-12-14 00:55:00', '2024-01-15 21:34:21'),
(9, 'The Technology you\'ll need to know in 2022', 'Following the tech world means keeping up with all the latest developments, but to truly understand how they’ll affect the world, you’ll want to know about these revolutions well before they develop and flourish. As someone who’s been in the business of upgrading clients’ software systems for a couple of decades now, I’ve seen several tech revolutions come and go, but what’s truly important is to know what’s next.\r\n\r\nThe tech that’s poised to revolutionize the future is still being built today, but an informed look at the current scene reveals a few areas that show signs of world-changing potential in the near future. The next generation of tech leadership stands to shatter the limits we’ve come to expect, with today’s curiosity poised to become tomorrow’s must-have. These are a few of the projects currently poised to become world-changers by the year 2020 and beyond.', '<p><span style=\"color:rgba(0, 0, 0, 0.9); font-family:-apple-system,system-ui,blinkmacsystemfont,segoe ui,roboto,helvetica neue,fira sans,ubuntu,oxygen,oxygen sans,cantarell,droid sans,apple color emoji,segoe ui emoji,segoe ui emoji,segoe ui symbol,lucida grande,helvetica,arial,sans-serif; font-size:16px\">Following the tech world means keeping up with all the latest developments, but to truly understand how they&rsquo;ll affect the world, you&rsquo;ll want to know about these revolutions well before they develop and flourish. As someone who&rsquo;s been in the business of upgrading clients&rsquo; software systems for a couple of decades now, I&rsquo;ve seen several tech revolutions come and go, but what&rsquo;s truly important is to know what&rsquo;s next.</span></p>\r\n\r\n<p><span style=\"color:rgba(0, 0, 0, 0.9); font-family:-apple-system,system-ui,blinkmacsystemfont,segoe ui,roboto,helvetica neue,fira sans,ubuntu,oxygen,oxygen sans,cantarell,droid sans,apple color emoji,segoe ui emoji,segoe ui emoji,segoe ui symbol,lucida grande,helvetica,arial,sans-serif; font-size:16px\">The tech that&rsquo;s poised to revolutionize the future is still being built today, but an informed look at the current scene reveals a few areas that show signs of world-changing potential in the near future. The next generation of tech leadership stands to shatter the limits we&rsquo;ve come to expect, with today&rsquo;s curiosity poised to become tomorrow&rsquo;s must-have. These are a few of the projects currently poised to become world-changers by the year 2020 and beyond.</span></p>\r\n\r\n<ul>\r\n	<li><strong>Transportation</strong></li>\r\n	<li><strong>Data Security</strong></li>\r\n	<li><strong>Computing Power</strong></li>\r\n	<li><strong>Nanotech</strong></li>\r\n	<li><strong>Mobile Payments</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Transportation</strong></p>\r\n\r\n<p><span style=\"color:rgba(0, 0, 0, 0.9); font-family:-apple-system,system-ui,blinkmacsystemfont,segoe ui,roboto,helvetica neue,fira sans,ubuntu,oxygen,oxygen sans,cantarell,droid sans,apple color emoji,segoe ui emoji,segoe ui emoji,segoe ui symbol,lucida grande,helvetica,arial,sans-serif; font-size:16px\">Self-driving cars&nbsp;<a href=\"https://www.nytimes.com/2018/03/23/technology/uber-self-driving-cars-arizona.html\" rel=\"nofollow noopener noreferrer\" style=\"box-sizing: border-box; background-color: rgb(252, 252, 252); cursor: pointer; color: rgb(0, 56, 145); text-decoration-line: none; -webkit-tap-highlight-color: transparent; font-family: tabular-numbers, Georgia, Cambria, \" target=\"_blank\">may not end up becoming</a>&nbsp;the revolutionary tech that many predicted they would, but the automotive field is undergoing severe disruption with or without automation. Electric cars, once strictly the domain of eco-conscious types, are forecasted to&nbsp;<a href=\"https://www.bloomberg.com/news/articles/2017-11-28/rise-of-electric-cars-quickens-pace-to-tesla-s-benefit\" rel=\"nofollow noopener noreferrer\" style=\"box-sizing: border-box; background-color: rgb(252, 252, 252); cursor: pointer; color: rgb(0, 56, 145); text-decoration-line: none; -webkit-tap-highlight-color: transparent; font-family: tabular-numbers, Georgia, Cambria, \" target=\"_blank\">go mainstream</a>, comprising nearly a sixth of all new cars within a few years of 2020. Due to the incredibly complex web of resources, politics and dependency tied into global petroleum, the convenience, speed and sustainability of electric automobiles present a favorable alternative, one poised to disrupt entire regions of the globe. As someone based in Detroit, I can tell you that the big car companies have been aware for a while that this was the inevitable next step for transportation, and you should be as well. The question is not if, but when.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Data Security</strong></p>\r\n\r\n<p><span style=\"color:rgba(0, 0, 0, 0.9); font-family:-apple-system,system-ui,blinkmacsystemfont,segoe ui,roboto,helvetica neue,fira sans,ubuntu,oxygen,oxygen sans,cantarell,droid sans,apple color emoji,segoe ui emoji,segoe ui emoji,segoe ui symbol,lucida grande,helvetica,arial,sans-serif; font-size:16px\">While much of the hype over cryptocurrency is overblown, there&rsquo;s a more certain revolution that&rsquo;s already happening just under its surface. Though the long-term economic potential of monetary instruments like bitcoin is doubtful, the tech that lies under the surface is already changing the fields of online security, record-keeping and reliability. Simply put, blockchain is a distributed data ledger that is incredibly strong and quite regularly scares away hackers. The information within is encrypted to keep it safe, but at the same time, it&#39;s stored across a huge network and has no central point of failure the way a normal server does. Nearly every client of my company, Quantam Solutions, is concerned about the security of their systems, and with advanced cryptography and cipher technologies, these worries can be no more. Blockchain is already utilized for transaction ledgers by major banks and data storage firms, and its full potential can potentially be used to keep our votes secure, ensure artists receive payment for their music and provide the long-needed solidification of data integrity on the internet.</span></p>', 'next_page_technology.jpg', 'the-technology-youll-need-to-know-in-2022', 0, 0, 0, 828, 0, '14 technologists predictions for our world in 2020', NULL, NULL, 1, NULL, 1, '2019-02-11 17:07:32', '2024-01-15 21:29:47');
