(11, 'We are Hiring - Executive (Finance & Accounts)', 'we-are-hiring-executive-finance-accounts-12', '2020-08-09', '2020-09-30', 'slider.jpg', '<p><strong>FULL STACK (PHP) DEVELOPER:</strong><br />\r\nVacancy -&nbsp;<strong>04</strong></p>\r\n\r\n<p>Next Page Technology Ltd. is in search of Full Stack (PHP) developers as part of their talented team.</p>\r\n\r\n<div class=\"text_exposed_show\" style=\"box-sizing: border-box; display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p><span style=\"font-size:16px\"><strong>Requirements :</strong></span><br />\r\n1. 2-3 more years of commercial working experience.<br />\r\n2. Good knowledge of functional and object-oriented PHP<br />\r\nExperience with Laravel and CodeIgniter.<br />\r\n3. Experience using relational databases using ORM, SQL (MySQL, MS SQL)<br />\r\n4. Knowledge with at least of one PHP template engine (Smarty, Twig)<br />\r\n5. Experience using HTML5, CSS3, Bootstrap4<br />\r\n6. JS frameworks (Vue.js, React, Angular) experience is preferred<br />\r\n7. Experience using GIT VCS<br />\r\n8. Ability to read and understand written code by other developers</p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>Technology</strong></span><br />\r\nPHP 7+, Laravel, CodeIgniter, Vue.js, React, MySQL, Redis, AWS,</p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>Preferred:</strong></span><br />\r\n1. Experience using REST or SOAP API<br />\r\n2. Experience in React Native is more preference<br />\r\n3. Unit tests experience.</p>\r\n\r\n<p>Salary:&nbsp;<span style=\"font-size:16px\"><strong>Negotiable</strong></span><br />\r\nJob Location - Dhaka</p>\r\n\r\n<p>Compensation &amp; Other Benefits<br />\r\nSalary Review: Yearly<br />\r\nFestival Bonus: 2</p>\r\n\r\n<p>Apply Procedure<br />\r\nInterested candidates are requested to forward their CV at&nbsp;<span style=\"font-size:16px\"><strong>career@nextpagetl.com</strong></span>&nbsp;and more details&nbsp;<a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fnextpagetl.com%2Fcareer%3Ffbclid%3DIwAR0Mz1J1nn1dabk1ud5ViJJxPp9_SHXs8oek4WZ-CK0PCEzNWO4rK_Ti334&amp;h=AT38J1qRFftAbMPUalusFU9Ooq8KZDSGNdnIe87sQipkSsQ5FOzOIBK4eyS5ZuRbsRQjP44V_BPlUQD6CwJJ7e6AjRrrWo02qrXKHcjWp1TETN_fM4s3pGGgq59Kyn2aEZyUkC4Fd-3IBye4aaphNwE97Q0CXAqMQ9VDpEcp5LF37kX2IFkHD5YO5G_p60Upz_gZTl4OSjKYkxCdPXcEF9uJOdMOniizw969Cd74j-TwyobQ-35ow75S1AG2klfrk-hK221P0yBaQW-tn6OiLUBziGzUKs1TzC1JYmwFo-03gRhF9T0LNLrOWoGilDMRiA5x2JffxvWLMIx8Zo_VUmQ-ZTWDfZsfMBL6YVrsELa5UMIZVbzMl7kUX1zspZX5oIlWtm3x2FHRSTU39RGsHkM5WQqeikpa_N0HMSjoXZhw-NSrxroLKQvRKJbPji5oC4vBtjWljMxQlzNMhFnmt-_FI428SfrzgDXJnulFlV3yGqR9lJftUo8n6kxLet9QqeGHuygVCrbP-jhXeADIxzirJqDEYBiMHUPoDJ_PUUyGC4Zo_iPLxWZA86fQl-JnM_A1t5sCCayyqMoLfSL-zNCUWZmgcomBMQTYQda56w5MEcrlBTGKZhRM5MuHc8muZpkWpW1X\" rel=\"noopener nofollow\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(56, 88, 152); text-decoration-line: none; touch-action: manipulation; transition: all 0.3s ease-in-out 0s; cursor: pointer; font-family: inherit;\" target=\"_blank\">https://nextpagetl.com/career</a><br />\r\nApplication Deadline: June 25, 2020</p>\r\n\r\n<p>Company Information NEXT PAGE TECHNOLOGY LTD.<br />\r\nAddress : House - 24 (4th Floor), Road - 02, Sector - 3, Uttara Model Town ,1230- Dhaka,</p>\r\n</div>', NULL, NULL, NULL, 1, 1, 1, '2020-08-09 22:23:55', '2020-09-26 17:54:35'),
