(11, 5, 'Website Design & Development', 'website-design-development', NULL, 'digital-advertising.jpg', '<h2 style=\"text-align:center\">Complete Web Solutions for Your Branding</h2>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4\" style=\"float: left;\">\r\n<ul>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Dynamic Website Management Panel</a></li>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Customized Design</a></li>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Responsive Website Design </a></li>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">High Security Standard</a></li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\" style=\"float: left;\">\r\n<ul>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Search engine friendly</a></li>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Website Hosting</a></li>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Quality Web Content</a></li>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Web application development</a></li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\" style=\"float: left;\">\r\n<ul>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Simple and Professional Web Design</a></li>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Clear, User-friendly Navigation</a></li>\r\n	<li><a href=\"#\" style=\"color: rgb(51, 122, 183);font-size: 15px;\">Webpage Speed</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"section-head\" style=\"font-size: 15px; margin-top: 22px;\">\r\n<div class=\"ab-page-title text-center\">\r\n<h1>Web Development Features</h1>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4>Responsive Web Design</h4>\r\n\r\n<h5>Set any Devices</h5>\r\n\r