(12, 6, 'Social Media Marketing', 'social-media-marketing', 'Facebook Marketing Sub title', 'digital-advertising.jpg', '<h2 style=\"text-align:center\">Help You With The Following Concepts :</h2>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Creating Social Media Ad/Through manage/ Through optimization.</li>\r\n	<li>Design a Fan page/ Doing Optimization.</li>\r\n	<li>Set up your Page</li>\r\n	<li>Identify your audience</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Creating Social Marketing Strategy</li>\r\n	<li>Advertise</li>\r\n	<li>Increasing targeted fan.</li>\r\n	<li>Making custom tab.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Posting related content (Picture, status, video).</li>\r\n	<li>Create compelling content</li>\r\n	<li>Increasing traffic to your website through Facebook.</li>\r\n	<li>Doing Brand and User Engagement Plan.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"package_margin_top\">\r\n<p>The rapid growth of internet facilities peoples are more easily can connect the social network. In a statics of facebook, Bangladesh is the second largest user country. Obviously, it&rsquo;s a great news for us. Our Country facebook user takes highest benefits of Facebook. Peoples are more likely use Facebook for taking update news every time. The business trend is now changing. Maximum business today depends on digital marketing &amp; facebook is the best place for advertising your business. You can update your business products/services just with a click and it will show on your target client feed. NPTL expertise in digital marketing especially in facebook marketing.</p>\r\n</div>\r\n</div>', 'a:4:{s:22:\"basic_pricing_subtitle\";N;s:23:\"silver_pricing_subtitle\";N;s:21:\"gold_pricing_subtitle\";N;s:24:\"premium_pricing_subtitle\";N;}', NULL, 0, 0, 0.00, NULL, 'a:4:{s:18:\"pricing_info_title\";s:16:\"Our Package List\";s:10:\"step_title\";N;s:13:\"step_subtitle\";N;s:10:\"step_image\"