(27, 6, 'School Management Software', 'school-management-software', NULL, 'terms-a-conditions-banner.png', '<h2 style=\"text-align:center\">School Management Software In Bangladesh</h2>\r\n\r\n<div class=\"col-12\">\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Admission Management</li>\r\n	<li>Account Management</li>\r\n	<li>Hostel Management</li>\r\n	<li>Human Resource Management</li>\r\n	<li>Users Management Software</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Library Management</li>\r\n	<li>Student Attendees Tracking and Analytics</li>\r\n	<li>Financial Management</li>\r\n	<li>Attendance Management</li>\r\n	<li>Automated Generated Routine</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Examination Management</li>\r\n	<li>Events Management</li>\r\n	<li>Fees Management</li>\r\n	<li>Evaluation Management</li>\r\n	<li>Website Development</li>\r\n</ul>\r\n</div>\r\n&nbsp;\r\n\r\n<div class=\"package_margin_top\">\r\n<p><strong>Next Page Technology Ltd. School Management Software&nbsp;</strong>&nbsp;is a complete Dynamic Academic Institution Management&nbsp;<strong>software</strong>, which is user friendly Web Based Software. This Software Coverd&nbsp;<strong>Academic Management, Account &amp; Fees Management, Attendance Tracking, Library Management, Online Fess Management etc</strong>. This solution is essential for every Educational Institute like English medium School, Bengali medium School, University, College, Madrasa etc. We Build Custom Software for Your Business Need! We work with you to ensure zero error, on-time delivery.</p>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style=\"font-size: 15px; margin-top: 22px;\">\r\n<div class=\"ab-page-title text-center\">\r\n<h1>Software Features</h1>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4>Academic Management</h4>\r\n\r\n<h5>Full Academic Management</h5>\r\n\r\n<p>Admission Management, Class and Section Management, Routine Management, Event Calendar, Examination Management, Result Management , Student Attendance etc. All kinds of Academic solution are available in one platform.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4>Account &amp; Fees Management</h4>\r\n\r\n<h5>Student &amp; General Account</h5>\r\n\r\n<p>Fees management system helps in billing students in this module. It also provides course fees details, student payment, mode of payment and balance information etc. Payment Entries, Account Summary, General Ledger etc include this software.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4>Attendance Tracking</h4>\r\n\r\n<h5>Real Time Attendance, SMS Sending</h5>\r\n\r\n<p>Attendance tracking with Proximity Card, Finger Print or Results, Daily Reports, Unique ID Communicate with students, parents and employees by sending SMS text messages right to their mobile phones from real time attendance system.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4>Faculty / Staff Management</h4>\r\n\r\n<h5>Payroll Management</h5>\r\n\r\n<p>Record and organize all employee details enabling quick access to employee information and effective management of employee Payroll Management and leave Management, Attendance Management, HR information Management.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4>Library Management</h4>\r\n\r\n<h5>Library Management</h5>\r\n\r\n<p>NTPT school management software&nbsp;is the complete library management and automation solution that enables information providers, Students &amp; librarians to manage &amp; disseminate information available in various kind of resources..</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4>SMS,&nbsp;e-Mail Send &amp; Export/Import</h4>\r\n\r\n<h5>SMS &amp; e-Mail Sending Facility</h5>\r\n\r\n<p>SMS &amp; e-Mail Send Facility there in Software, School Management can send SMS to students, parents or teachers, by the selecting in system all Student/Parents/Teachers one by one or at once &amp; out of database &amp; can export &amp; import as csv, excel file.</p>\r\n</div>\r\n</div>\r\n</div>', 'a:4:{s:22:\"basic_pricing_subtitle\";N;s:23:\"silver_pricing_subtitle\";N;s:21:\"gold_pricing_subtitle\";N;s:24:\"premium_pricing_subtitle\";N;}', NULL, 0, 0, 0.00, NULL, 'a:4:{s:18:\"pricing_info_title\";s:16:\"Our Package List\";s:10:\"step_title\";N;s:13:\"step_subtitle\";N;s:10:\"step_image\";N;}', NULL, NULL, NULL, 1, NULL, 1, '2018-12-08 21:56:43', '2019-11-12 21:46:20'),
(28, 6, 'Pharmacy Management Software', 'pharmacy-management-software', NULL, 'blog-details-banner.jpg', '<h2 style=\"text-align:center\">Pharmacy Management Software in Bangladesh</h2>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Product Entry</li>\r\n	<li>Product Sales feature</li>\r\n	<li>Product Purchase feature</li>\r\n	<li>Inventory Management</li>\r\n	<li>Sales reporting and analytics</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Customer Account Management</li>\r\n	<li>Employee management</li>\r\n	<li>Barcode Generation</li>\r\n	<li>Accounts Management</li>\r\n	<li>Barcode Scanning</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Pricing Management</li>\r\n	<li>Retail Management</li>\r\n	<li>Discount Management</li>\r\n	<li>Returns Tracking</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"package_margin_top\">\r\n<p>Smart POS Pharmacy Software helps shop owners to manage different records like Billing Records, Client wise Reports, accurate stocking of Drugs, Reports, Order Management in one go. Get automatic updates on Negative Stocks, updates on pending prescription, Expiry Stock alerts, Reminder regarding appointments and keep a check on Sales or purchase of restricted items. Smart POS is a most user friendly Point of Sales in Bangladesh. This POS Software is Online Offline Software. This a Browser based Solution which combines Multi-user Account System, Responsive user Interface, Accounting anytime, anywhere, powerful reporting, easy to Customization, Customization Report etc. Simple, easy-to-use cloud POS software to help you manage your business, the smart way! We Build Custom Software for Your Business Need! We work with you to ensure zero error, on-time delivery.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"section-head\" style=\"font-size: 15px; margin-top: 22px;\">\r\n<div class=\"ab-page-title text-center\">\r\n<h1>Software Features</h1>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4 col-sm-12\">\r\n	<div class=\"packageFeaturesBox\">\r\n<h4>Inventory-Sales</h4>\r\n\r\n<h5>Inventory Sales Modules</h5>\r\n\r\n<p>Product Order, Stock Management, Sales Management with Bar-code (POS Sale), Profit &amp; Loss, Supplier &amp; Client Manage.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n	<div class=\"packageFeaturesBox\">\r\n<h4>General Accounts</h4>\r\n\r\n<h5>General Spending &amp; Income</h5>\r\n\r\n<p>Project-wise Accounts Management, Receivables &amp; Payables Entry, Due Payment, Balance Transference to other account, Account wise Monthly-Yearly Report etc.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n	<div class=\"packageFeaturesBox\">\r\n<h4>Salary Management</h4>\r\n\r\n<h5>Payroll Management System</h5>\r\n\r\n<p>Employ Information, Employee Pay clip Generate, Employee Advance Payment, Advance Adjustment, Report, SMS Communication.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n	<div class=\"packageFeaturesBox\">\r\n<h4>Cable Billing</h4>\r\n\r\n<h5>Cable TV &amp; Internet Line Billing</h5>\r\n\r\n<p>Cable TV Billing, Internet Line Billing, Utility Billing Automatic Invoice Generate Every Month, Line Man Wise Bill, Area Wise Bill, Bill Pay by Mobile (bKash) Bank, SMS Sending etc.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n	<div class=\"packageFeaturesBox\">\r\n<h4>Production-Costing</h4>\r\n\r\n<h5>Manufacturer Calculating</h5>\r\n\r\n<p>The cornerstone of financial analysis for any manufacturer is calculating an accurate product cost &amp; Inventory. Row Material Management, Production Function &amp; Cost Management.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n	<div class=\"packageFeaturesBox\">\r\n<h4>SMS &amp; e-Mail Send</h4>\r\n\r\n<h5>SMS &amp; e-Mail Sending Facility</h5>\r\n\r\n<p>SMS &amp; e-Mail Send Facility there in Software, Organization can send SMS to Client, by the selecting in system all Member/ Client one by one or at once &amp; out of database.</p>\r\n</div>\r\n</div>\r\n</div>', 'a:4:{s:22:\"basic_pricing_subtitle\";s:36:\"Monthly Service & Server Cost 500 TK\";s:23:\"silver_pricing_subtitle\";s:36:\"Monthly Service & Server Cost 800 TK\";s:21:\"gold_pricing_subtitle\";s:38:\"Monthly Service & Server Cost 1,000 TK\";s:24:\"premium_pricing_subtitle\";s:38:\"Monthly Service & Server Cost 3,000 TK\";}', NULL, 0, 0, 0.00, NULL, 'a:4:{s:18:\"pricing_info_title\";s:46:\"Pricing Table for Pharmacy Management Software\";s:10:\"step_title\";N;s:13:\"step_subtitle\";N;s:10:\"step_image\";N;}', NULL, NULL, NULL, 1, NULL, 1, '2018-12-08 22:12:22', '2018-12-27 17:35:20'),
(29, 5, 'Tailor Management Software', 'tailor-management-software', NULL, 'tailor3-.jpg', '<h2 style=\"text-align:center\">Tailor Management Software</h2>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Easy Measurement System</li>\r\n	<li>No installation is required</li>\r\n	<li>Dynamic Report Generation</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Purchase Module</li>\r\n	<li>Sales Module</li>\r\n	<li>Profit/Loss</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Fabrics Style Module</li>\r\n	<li>Email Module</li>\r\n	<li>POS</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"package_margin_top\">\r\n<p>We have developed this software for fulfill the needs of ladies and gents tailoring shops and providing complete solution of fabric retailers&nbsp;&amp; Business. Accounting Inventory Management Systems Integration is a complete software package for the tailoring shops &amp; Fabric Retailers. Next Page Technology Ltd. manages the customers, measurements, Dresses, Styles, payments, expenses, orders and deliveries which gives instant status report of works in processing by SMS.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"section-head\" style=\"font-size: 15px; margin-top: 22px;\">\r\n<div class=\"ab-page-title text-center\">\r\n<h1>Software Features</h1>\r\n</div>\r\n</div>\r\n\r\n<div class=\"section-head\" style=\"font-size: 15px; margin-top: 22px;\">\r\n<div class=\"ab-page-title\">\r\n<div>&bull; It is very easy to use, and no installation is required.</div>\r\n\r\n<div>&bull; Zero data loss and 100 percent secure.</div>\r\n\r\n<div>&bull; Easy to excess, excess form anywhere (home, shop or office) and any device (PC, Laptop, Tab or Smartphone)</div>\r\n\r\n<div>&bull; Customers can be searched by their Registration number or name or phone number.</div>\r\n\r\n<div>&bull; Each customer&rsquo;s measurement will be recorded automatically.</div>\r\n\r\n<div>&bull; While ordering the system will show the measurement of the customers and if not recorded earlier, can be added with a few clicks.</div>\r\n\r\n<div>&bull; Each ordered job will be available in a list to send cutter and tailor. Status of a tailoring job in hand will instantly be available.</div>\r\n\r\n<div>&bull; System will maintain the customers and accounts and payment record.</div>\r\n\r\n<div>&bull; System will maintain the customer&rsquo;s account and will reflects previous outstanding, if any in new ordering receipt.</div>\r\n\r\n<div>&bull; Showing various dresses and styles to the customers during taking order.</div>\r\n\r\n<div>&bull; SMS Service with brand name (Completed work order, Delivery confirmation, Payment notification and providing any kind of Notice and greetings to Customers)</div>\r\n</div>\r\n</div>', 'a:3:{s:22:\"basic_pricing_subtitle\";N;s:23:\"silver_pricing_subtitle\";N;s:21:\"gold_pricing_subtitle\";N;}', NULL, 0, 0, 0.00, NULL, 'a:4:{s:18:\"pricing_info_title\";s:41:\"Pricing Table for ERP Management Software\";s:10:\"step_title\";N;s:13:\"step_subtitle\";N;s:10:\"step_image\";N;}', NULL, NULL, NULL, 1, NULL, 1, '2018-12-08 22:26:33', '2019-03-07 18:20:39');
