(30, 5, 'ERP Software', 'erp-software', NULL, 'our-story.jpg', '<h2 style=\"text-align:center\">Garments ERP Software</h2>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Merchandising &amp; Marketing</li>\r\n	<li>Library</li>\r\n	<li>TNA</li>\r\n	<li>Planning</li>\r\n	<li>Inventory</li>\r\n	<li>Production</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Accounts</li>\r\n	<li>CRM</li>\r\n	<li>Payroll</li>\r\n	<li>Account Management Software</li>\r\n	<li>Sales &amp; Invoice Management</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Store &amp; Assets</li>\r\n	<li>Inventory Managemtn</li>\r\n	<li>Point Of Sales (POS)</li>\r\n	<li>Production Management</li>\r\n	<li>Reports Management</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"package_margin_top\">\r\n<p>&ldquo;Benefits&rdquo; of Next Page Garments Offer: &bull; Manage &amp; integrate all aspects of the business key functions including: order entry, sample, IE, inventory, merchandising, production &amp; Finance. &bull; Determination to achieve lower prices, better quality and quicker delivery, as a result, increase in confidence from business partners and buyers. &bull; Provides right information to the right people at the right time anywhere in the world, enabling you to improve productivity, enhance decision making capabilities and promote communication between co-workers, suppliers and buyers. &bull; Reduce and eliminate duplicate work and automate operational tasks to save time &amp; cost. &bull; Turn the way of access information easy with proper confidentiality. &bull; Standardizes the manufacturing processes and improves quality within multiple business units across the company.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"section-head\" style=\"font-size: 15px; margin-top: 22px;\">\r\n<div class=\"ab-page-title text-center\">\r\n<h1>Software Features</h1>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4><strong>Merchandising &amp; Marketing</strong></h4>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Order Tracking</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Fabric Booking</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Trims Booking</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Approval Tracking</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Service Booking</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;</strong><strong>&nbsp;&nbsp; Merchandising Reports</strong></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4><strong>Library</strong></h4>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Contact Details</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Item Details</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Merchandising Details</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Production</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; General</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Subcontract</strong></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4><strong>TNA</strong></h4>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Task/Job/Order Management/Monitoring</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Task Scheduling (Font/Back Calculation)</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; TNA Progress Report</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Export/Import data in CSV/Excel format</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp; &nbsp;TNA&nbsp; Graphical View of TNS</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp; &nbsp;TNA&nbsp;&nbsp; Split a task at any level/Dependency</strong></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4><strong>Planning</strong></h4>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Knitting Plan</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Work Study</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; MIS Reports</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Work Order</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Commercial</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Line Planning (Loading/Unloading)</strong></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4><strong>Inventory</strong></h4>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Purchase Requisition</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Yarn Store</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Grey Fabric Store</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Finish Fabric Store</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Trims Store</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Dyes And Chemical Store</strong></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-12\">\r\n<div class=\"packageFeaturesBox\">\r\n<h4><strong>Production</strong></h4>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Knit Composite</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Fabric Production</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp;&nbsp; Garments Production</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Report Generate</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Inspection</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>&bull;&nbsp;&nbsp; Ex-Fact</strong></p>\r\n</div>\r\n</div>\r\n</div>', 'a:3:{s:22:\"basic_pricing_subtitle\";N;s:23:\"silver_pricing_subtitle\";N;s:21:\"gold_pricing_subtitle\";N;}', NULL, 0, 0, 0.00, NULL, 'a:4:{s:18:\"pricing_info_title\";s:17:\"OUR PRICING TABLE\";s:10:\"step_title\";N;s:13:\"step_subtitle\";N;s:10:\"step_image\";N;}', 'ERP Software Development company in Bangladesh', 'sms api bangladesh, online accounting software in bangladesh,  ecommerce website developer in bangladesh, garment merchandising software, social media marketing in bangladesh, garments inventory management system,  restaurant management software, web design bangladesh', 'sms api bangladesh, online accounting software in bangladesh,  ecommerce website developer in bangladesh, garment merchandising software', 1, NULL, 1, '2018-12-08 22:31:06', '2019-06-25 21:11:07'),
(31, 6, 'Email Marketing', 'email-marketing', NULL, 'our-story.jpg', '<h2>Why Email Marketing?</h2>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Quick response &amp; quick delivery.</li>\r\n	<li>Lowest cost and highest benefit.</li>\r\n	<li>Directly reach to the targeted people.</li>\r\n	<li>Website address and email address can be linked directly.</li>\r\n	<li>Advertising space is not a issue. You can use unlimited space for advertisement.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>Cost effective.</li>\r\n	<li>Specific Clients area.</li>\r\n	<li>80-90% inbox delivery.</li>\r\n	<li>24*7 customer support.</li>\r\n	<li>Spam and bounce detector.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<ul>\r\n	<li>1 by 1 email sending system.</li>\r\n	<li>SMTP server with dedicated IP.</li>\r\n	<li>150+ satisfied clients worldwide.</li>\r\n	<li>Free consultancy for better advertisement.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"package_margin_top\">\r\n<p>Our email marketing software is web based. We will provide you our software access from where you can easily check the LIVE report of email marketing that how much email is send.&nbsp;You can ensure your email marketing from the LIVE report from our software or visiting our office or from response.</p>\r\n\r\n\r\n</div>\r\n</div>\r\n\r\n<div class=\"section-head\" style=\"font-size: 15px; margin-top: 22px;\">\r\n<h2Email marketing requirement:</h2>\r\n<div class=\"ab-page-title\">\r\n<ul>\r\n	<li>Email body (Content may be picture or plain text or picture, text both or html formate).</li>\r\n	<li>Email subject (Not more than 80 characters).</li>\r\n	<li>Company name (Not more than 40 characters).</li>\r\n	<li>Email address.</li>\r\n</ul>\r\n</div>\r\n</div>', 'a:4:{s:22:\"basic_pricing_subtitle\";N;s:23:\"silver_pricing_subtitle\";N;s:21:\"gold_pricing_subtitle\";N;s:24:\"premium_pricing_subtitle\";N;}', NULL, 0, 0, 0.00, NULL, 'a:4:{s:18:\"pricing_info_title\