(2, 'Terms & Conditions', 'Terms & Conditions', 'Everything As Fair & Easy As You Want', 'bradcroumb_1.jpg', '<h3>Information Collection and Use</h3>\r\n\r\n<p>As a modern digital marketing agency, Next Page Technology Ltd. collects personal information when you register or contact us from our website. As a buyer, we collect your name, address, email, and telephone number. If you upload and archive documents, we also collect the name and address you wish payments to be made to.</p>\r\n\r\n<p>Next Page Technology Ltd. uses information for the following general purposes: to customize the advertising and content you see, fulfill your requests for products and services, improve our services, contact you, conduct research, and provide anonymous reporting for internal and external clients.</p>\r\n\r\n<h3>Information Sharing and Disclosure</h3>\r\n\r\n<p>Next Page Technology Ltd. does not rent, sell, or share personal information about you with other people or nonaffiliated companies except to provide products or services you&#39;ve requested, when we have your permission, or under the following circumstances:</p>\r\n\r\n<ul>\r\n	<li>We respond to subpoenas, court orders, or legal process, or to establish or exercise our legal rights or defend against legal claims;</li>\r\n	<li>We believe it is necessary to share information in order to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of Next Page Technology Ltd.&#39;s terms of use, or as otherwise required by law.</li>\r\n	<li>Business Transfers: As we continue to develop our business, we might sell or buy services, stores, or assets. In such transactions, visitor information is usually one of the transferred business assets. Also, in the unlikely event that Next Page Technology Ltd. is acquired, or substantially all of its assets are acquired, customer information will of course be one of the transferred assets.</li>\r\n	<li>Credit card information will never be disclosed by Next Page Technology Ltd. and follow the conditions of use established by Visa, Mastercard, Discover, Amex, and PayPal.</li>\r\n</ul>\r\n\r\n<h3>Terms of Service, Notices, and Revisions</h3>\r\n\r\n<p>If you choose to visit Next Page Technology Ltd., your visit and any dispute over privacy is subject to this Notice and our Conditions of Use, including limitations on damages, arbitration of disputes, and application of the law of the state of Pennsylvania. If you have any concern about privacy at Next Page Technology Ltd., please send us a thorough description to info@nextpagetl.com, and we will try to resolve it. Our business changes constantly. This Notice and the Conditions of Use will change also and use of information that we gather now is subject to the Privacy Policy in effect at the time of use. You should check our website frequently to see recent changes.</p>\r\n\r\n<h3>Newsletters</h3>\r\n\r\n<p>Being digital marketing agency by nature, we send newsletters to you and will not sell your email address to 3rd parties. You may choose to opt-out of the newsletter at any time by following the unsubscribe instructions in each newsletter or by contacting us directly. By default, all contact from our website is entered into our CRM and newsletter distribution list. If you would prefer not to be added to our email distribution list, please specify this in the body of email or contact from submission to us.</p>\r\n\r\n<h3>Copyright</h3>\r\n\r\n<p>The digital images and transcripts of documents on Next Page Technology Ltd. are the copyright of Next Page Technology Ltd. through our photo licenses with other providers or are the individual copyright of Next Page Technology Ltd..</p>\r\n\r\n<p>The index and all related website content are the copyright of Next Page Technology Ltd..</p>\r\n\r\n<h3>Permitted Use</h3>\r\n\r\n<p>Visitors to this website are granted permission to access this material, to download and copy such material on to electronic, magnetic, optical or similar storage media and to make printed copies of any such downloaded material, provided that such activities and copies are for non-commercial private study and research only.</p>\r\n\r\n<h3>Restricted Use</h3>\r\n\r\n<p>Visitors to this website may not copy, distribute, screen shot, reproduce, sell or publish any of the copyright material downloaded or copies from this website. For the avoidance of doubt, no permission is given for the transfer of any of this material to an open internet site. For permission, please contact info@nextpagetl.com. Next Page Technology Ltd. monitors the web closely for violations of our user policy.</p>', 'Our Terms & Conditions | A Fair IT Company', 'digital marketing agency', 'Next Page Technology Ltd. follows the standard procedures regarding the terms and conditions applicable to users. As a conscious digital marketing agency, we always stay updated with the latest guidelines.', 'terms-conditions', NULL, 1297, 1, 9, 1, '2017-10-24 23:07:17', '2024-01-27 06:39:22'),
(4, 'Privacy Policy', 'Privacy Policy', 'Assurance For Confidentiality Of User Information', 'bradcroumb_1.jpg', '<p>Next Page Technology Ltd., a proactive digital marketing agency, has its Privacy Policy that governs and describes how Next Page Technology Ltd. gathers, uses, keeps tracks of and discloses user information (each, a &ldquo;User&rdquo;) of the http://nextpagetl.com/ website (&ldquo;Site&rdquo;). This privacy policy is applicable to the Site as well as all its products and services.</p>\r\n\r\n<h3>Personal identification information</h3>\r\n\r\n<p>We may collect Users&rsquo; personal identification information in different ways that might include but not be limited to, the time users visit the Site, signup with the Site, make an order, subscribe to our newsletter, provide response to any of our surveys, fill out any form, and in relation with other services, features, activities, or resources available on the Site.</p>\r\n\r\n<p>We may ask Users for, as suitable, full name, email and mailing address, cell number, and credit card information. However, Users may visit the site anonymously. We will collect and store Users&rsquo; personal identification information only when they submit the information voluntarily. Users can avoid supplying personally identification information if they want, except that such avoidance may not allow them to participate in certain activities.</p>\r\n\r\n<h3>Non-personal identification information</h3>\r\n\r\n<p>Non-personal identification information may be collected as Users do any interaction with the Site. Such information may include the device name, browser name, operating system, name of ISP, and other technical information.</p>\r\n\r\n<h3>Web Cookies:</h3>\r\n\r\n<p>Cookies may be used to improve User experience. The web browsers used by Users put cookies on their personal computers&rsquo; hard drives for keeping records and at times to keep track of information about them. It is permitted that User can customize their browsers to refuse cookies, or to send them alerts as cookies are sent. If cookies are refused, some features of the Site may function inappropriately.</p>\r\n\r\n<h3>Use of the collected information:</h3>\r\n\r\n<p>Following are the purposes Next Page Technology Ltd. may use the collected User information.</p>\r\n\r\n<ul>\r\n	<li>To improve User service and be able to respond to their queries or service requests efficiently.</li>\r\n	<li>To be able to personalize user experience by understanding how Users use the resources or service on the Site.</li>\r\n	<li>To improve the Site or its services using customers&rsquo; feedback as the guidance in particular.</li>\r\n	<li>To process online payments as users, place orders and make payments. (Information is not shared with any outside party except the amount of information required compulsorily for the service)</li>\r\n	<li>To make arrangement for a contest, survey, promotion, and similar online events.</li>\r\n	<li>To offer Users resources or information as per their agreement to receive them about different topics that we find useful for them.</li>\r\n	<li>To send users on a periodic basis.</li>\r\n</ul>\r\n\r\n<h3>How to unsubscribe?</h3>\r\n\r\n<p>If the User feels it is right to unsubscribe from getting our future emails regarding different digital marketing agency services and offers, he/she can go through our detailed unsubscribe guidelines located at the bottom of any email they received from us. However, the User may, if required, contact us directly via our Site.</p>\r\n\r\n<h3>Protection of User information:</h3>\r\n\r\n<p>We follow appropriate and legitimate methods to collect, store, and process data. We adopt strong security measures to ensure maximum protection against any instance of alteration, unauthorized access, destruction of personal information, login credentials, transaction information, disclosure, and any sensitive data stored on the Site.</p>\r\n\r\n<h3>Sharing your personal information</h3>\r\n\r\n<p>We do not sell, trade, or rent Users personal identification information to others. We may share generic aggregated demographic information not linked to any personal identification information regarding visitors and users with our business partners, trusted affiliates and advertisers for the purposes outlined above. We may use third party service providers to help us operate our business and the Site or administer activities on our behalf, such as sending out newsletters or surveys. We may share your information with these third parties for those limited purposes provided that you have given us your permission.</p>\r\n\r\n<h3>Compliance with children&rsquo;s online privacy protection act</h3>\r\n\r\n<p>Protecting the privacy of the very young is especially important. For that reason, we never collect or maintain information at our Site from those we actually know are under 13, and no part of our website is structured to attract anyone under 13.</p>\r\n\r\n<h3>Changes to this privacy policy</h3>\r\n\r\n<p>Next Page Technology Ltd. has the discretion to update this privacy policy at any time. When we do, we will revise the updated date at the bottom of this page. We encourage Users to frequently check this page for any changes to stay informed about how we are helping to protect the personal information we collect. You acknowledge and agree that it is your responsibility to review this privacy policy periodically and become aware of modifications.</p>\r\n\r\n<h3>Your acceptance of these terms</h3>\r\n\r\n<p>By using this Site, you signify your acceptance of this policy. If you do not agree to this policy, please do not use our Site. Your continued use of the Site following the posting of changes to this policy will be deemed your acceptance of those changes.</p>', 'Our Privacy Policy | A Complete Software Company', 'Software Company', 'Next Page Technology Ltd. has experienced what users love to share with a website and what not. Also, we know as a well-aware Software Company we need to ensure that the data of our users are safe and private.', 'privacy-policy', NULL, 1388, 1, 9, 1, '2018-03-29 03:03:07', '2024-01-27 06:39:29'),
