(22, 32, 0, 'Sodium Metabisulphite', 'sodium-metabisulphite', 'It is used as a disinfectant, antioxidant, and preservative agent.', 0, NULL, NULL, '<p><span style=\"color:rgb(77, 81, 86); font-family:arial,sans-serif; font-size:14px\">It is used as a disinfectant, antioxidant, and preservative agent. When dissolved in water it forms sodium bisulfite</span></p>', 1, NULL, '2023-10-20 11:06:46', '2023-10-20 11:07:20'),
(23, 32, 0, 'Polyvinyl alcohol (PVA)', 'polyvinyl-alcohol-pva', 'Polyvinyl alcohol (PVA) is a hydrophilic synthetic polymer generated by the hydrolysis of poly(vinyl acetate), which is formed by the polymerization of vinyl acetate.', 0, NULL, NULL, '<p><span style=\"color:rgb(0, 0, 0); font-family:-webkit-standard; font-size:medium\">Polyvinyl alcohol (</span><span style=\"color:rgb(0, 0, 0)\">PVA) is&nbsp;<span style=\"background-color:rgba(80, 151, 255, 0.18); color:rgb(4, 12, 40)\">a hydrophilic synthetic polymer generated by the hydrolysis of poly(vinyl acetate), which is formed by the polymerization of vinyl acetate</span>. This material has been pursued for tissue engineering because it is nontoxic, biocompatible, biodegradable, and widely available</span></p>', 1, NULL, '2023-10-20 11:09:09', '2023-10-20 11:09:09'),
(24, 32, 0, 'Nonionic surfactants', 'nonionic-surfactants', 'Non-ionic surfactants are used as a grease remover in detergents, household cleaners and dish soap. They offer excellent solubility and produce a low amount of foam. When combined with anioni', 0, NULL, NULL, '<p><span style=\"color:rgb(31, 31, 31); font-family:google sans,arial,sans-serif; font-size:20px\">Non-ionic surfactants are used&nbsp;</span><span style=\"background-color:rgba(80, 151, 255, 0.18); color:rgb(4, 12, 40); font-family:google sans,arial,sans-serif; font-size:20px\">as a grease remover in detergents, household cleaners and dish soap</span><span style=\"color:rgb(31, 31, 31); font-family:google sans,arial,sans-serif; font-size:20px\">. They offer excellent solubility and produce a low amount of foam. When combined with anionic surfactants, non-ionic surfactants provide resistance to hard water in textile detergents.</span></p>', 1, NULL, '2023-10-20 11:10:20', '2023-10-20 11:10:20'),
(25, 32, 0, 'Sodium Alginate', 'sodium-alginate', 'In the food industry, alginate is used as a thickening agent, gelling agent, emulsifier, stabilizer, texture-improver. Nowadays, alginate is added to numerous kinds of food, such as ice cream', 0, NULL, NULL, '<p><span style=\"color:rgb(31, 31, 31); font-family:google sans,arial,sans-serif; font-size:20px\">In the food industry, alginate is used as a&nbsp;</span><span style=\"background-color:rgba(80, 151, 255, 0.18); color:rgb(4, 12, 40); font-family:google sans,arial,sans-serif; font-size:20px\">thickening agent, gelling agent, emulsifier, stabilizer, texture-improver</span><span style=\"color:rgb(31, 31, 31); font-family:google sans,arial,sans-serif; font-size:20px\">. Nowadays, alginate is added to numerous kinds of food, such as ice cream, jelly, acid milk drinks, dressings, instant noodles,&nbsp;etc.</span></p>', 1, NULL, '2023-10-20 11:13:33', '2023-10-20 11:13:33'),
(26, 32, 0, 'Polyvinyl Acetate Emulsion', 'polyvinyl-acetate-emulsion', 'As a dispersion in water (usually an emulsion), PVAc preparations are used as adhesives for porous materials, particularly for wood, paper, and cloth, and as a consolidant for porous building', 0, NULL, NULL, '<p><span style=\"color:rgb(31, 31, 31); font-family:google sans,arial,sans-serif; font-size:20px\">As a dispersion in water (usually an emulsion), PVAc preparations are used as&nbsp;</span><span style=\"background-color:rgba(80, 151, 255, 0.18); color:rgb(4, 12, 40); font-family:google sans,arial,sans-serif; font-size:20px\">adhesives for porous materials, particularly for wood, paper, and cloth, and as a consolidant for porous building stone, in particular sandstone</span><span style=\"color:rgb(31, 31, 31); font-family:google sans,arial,sans-serif; font-size:20px\">. Uses: As wood glue, PVAc is known as &quot;white glue&quot; and the yellow as &quot;carpenter&#39;s glue&quot;.</span></p>', 1, NULL, '2023-10-20 11:19:26', '2023-10-20 11:19:26'),
(27, 34, 0, 'Silicone Fluid 1000CST', 'silicone-fluid-1000cst', 'Silicone Fluid for Sewing Thread Lubrication', 0, NULL, NULL, '<p><span style=\"color:rgb(31, 31, 31); font-family:google sans,arial,sans-serif; font-size:20px\">It is used as a lubricant and release agent in a wide range of applications that include: Sewing Thread Lubrication,&nbsp;</span><span style=\"background-color:rgba(80, 151, 255, 0.18); color:rgb(4, 12, 40); font-family:google sans,arial,sans-serif; font-size:20px\">Food Processing, Food Packaging, Manufacture of Paper and Paperboard for Food Products, Food Treatment, Bottling and Canning, Food Transportation and Food Shipment</span><span style=\"color:rgb(31, 31, 31); font-family:google sans,arial,sans-serif; font-size:20px\">.</span></p>', 1, NULL, '2023-10-20 11:23:12', '2023-10-20 11:23:12'),
(28, 32, 0, 'Glycerine', 'glycerine', 'Glycerine have many uses Thickening agent, Moistening agent, Preservative', 0, NULL, NULL, '<div class=\"RqBzHd\" style=\"font-size: 16px; padding: 0px 20px; caret-color: rgb(32, 33, 36); color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, arial, sans-serif;\">\r\n<p>Hyperosmotic laxative (drawing water to the bowels to treat constipation), Vehicle for numerous pharmaceutical preparations,&nbsp;Agent to help oil and water-based ingredients mix efficiently.</p>\r\n</div>', 1, NULL, '2023-10-20 11:27:55', '2023-10-20 11:27:55');
