(20, 'sm_theme_options_home_setting', 'a:10:{s:17:\"seo_feature_title\";s:23:\"Journey To The 1st Page\";s:23:\"seo_feature_description\";s:241:\"Long or short, every trip to the first page of search engine involves proper coordination and implementation of multiple phases, such as research and analysis, planning, prototyping, and execution. Here’s a breakdown of the entire process.\";s:19:\"seo_marketing_title\";s:15:\"Eco Colour Chem\";s:25:\"seo_marketing_description\";s:1013:\"<p>Eco Colour Chem is a company that was founded in 2006 with the goal of providing sustainable and eco-friendly products to the textile industry.</p>\r\n\r\n<p>We have a strong commitment to quality and customer service, and our dedicated technical team is constantly engaged in research and development to bring innovative products to market.</p>\r\n\r\n<p>As the world becomes increasingly focused on sustainability, we are dedicated to supporting the textile industry with products that meet this demand. We have already established ourselves as a trusted and reliable partner in the industry, and we are always open to working on new development projects and partnerships.</p>\r\n\r\n<p>We have a large team of dedicated professionals and a full range of logistics support, with offices in Dhaka and Chattagram, as well as a warehouse in Gazipur. We believe that by working together, we can grow and achieve sustainability in the industry. If you have any questions or feedback, our team is always available to help.</p>\";s:22:\"seo_video_youtube_link\";s:41:\"https://www.youtube.com/embed/sibM97ndRjk\";s:26:\"seo_marketing_video_poster\";s:34:\"imgpsh_fullsize_anim__281_29_2.png\";s:19:\"seo_marketing_video\";s:12:\"mission1.jpg\";s:14:\"branding_title\";s:16:\"Valuable Clients\";s:17:\"branding_subtitle\";s:63:\"Claritas est etiam processus dynamicus, qui sequitur mutationem\";s:5:\"logos\";s:23:\"ecocolor-1498802148.png\";}', 1, 9, 1, 2, NULL, '2024-01-31 04:41:37'),
(21, 'sm_theme_options_contact_setting', 'a:8:{s:20:\"contact_banner_title\";s:10:\"CONTACT US\";s:20:\"contact_banner_image\";s:16:\"bradcroumb_1.jpg\";s:13:\"contact_title\";s:10:\"Contact Us\";s:18:\"contact_form_title\";s:18:\"LEAVE US A MESSAGE\";s:28:\"contact_form_success_message\";s:64:\"Mail successfully send. We will contact you as soon as possible.\";s:16:\"contact_branches\";a:2:{i:0;a:6:{s:5:\"title\";s:9:\"Address: \";s:7:\"address\";s:196:\"Dhaka Office:- House # 9 (9th floor), Road # 2, Sector # 3, Uttara, Dhaka-1230, Bangladesh\n\nChittagong Office:- Sultan Monzil (2nd floor), 119, Sk. Mujib Road, Agrabad, Chittagong-4100, Bangladesh\";s:14:\"footer_address\";s:0:\"\";s:5:\"email\";s:23:\"ecocolourchem@gmail.com\";s:6:\"mobile\";s:0:\"\";s:5:\"image\";s:12:\"usa-flag.png\";}i:1;a:6:{s:5:\"title\";s:14:\"Md. Sohel Rana\";s:7:\"address\";s:13:\"Head of Sales\";s:14:\"footer_address\";s:0:\"\";s:5:\"email\";s:27:\"mkt.ecocolourchem@gmail.com\";s:6:\"mobile\";s:0:\"\";s:5:\"image\";s:14:\"soudi-flag.png\";}}s:25:\"contact_location_latitude\";s:9:\"23.797424\";s:26:\"contact_location_longitude\";s:275:\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1112.9228427902929!2d90.39805212951696!3d23.862243500000005!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3755c5802277c2d1%3A0x83872b7e320b64fd!2sWhatsOn%20BD%20Office!5e1!3m2!1sen!2sbd!4v1656135800590!5m2!1sen!2sbd\";}', 1, 9, 1, 2, NULL, '2024-01-27 09:22:12'),
(22, 'sm_theme_options_about_setting', 'a:13:{s:18:\"about_banner_title\";s:8:\"ABOUT US\";s:21:\"about_banner_subtitle\";s:33:\"Quality, Sustainability & Service\";s:18:\"about_banner_image\";s:12:\"img_3316.jpg\";s:9:\"wwr_title\";s:10:\"Who we are\";s:12:\"wwr_subtitle\";s:41:\"Sustainable Products, Exceptional Service\";s:15:\"wwr_description\";s:1956:\"<p><span style=\"font-family:söhne,ui-sans-serif,system-ui,-apple-system,segoe ui,roboto,ubuntu,cantarell,noto sans,sans-serif,helvetica neue,arial,apple color emoji,segoe ui emoji,segoe ui symbol,noto color emoji; font-size:16px\">Eco Colour Chem is a company that was founded in 2006 with the goal of providing sustainable and eco-friendly products to the textile industry. </span></p>\r\n\r\n<p><span style=\"font-family:söhne,ui-sans-serif,system-ui,-apple-system,segoe ui,roboto,ubuntu,cantarell,noto sans,sans-serif,helvetica neue,arial,apple color emoji,segoe ui emoji,segoe ui symbol,noto color emoji; font-size:16px\">We have a strong commitment to quality and customer service, and our dedicated technical team is constantly engaged in research and development to bring innovative products to market. As the world becomes increasingly focused on sustainability, we are dedicated to supporting the textile industry with products that meet this demand. </span></p>\r\n\r\n<p><span style=\"font-family:söhne,ui-sans-serif,system-ui,-apple-system,segoe ui,roboto,ubuntu,cantarell,noto sans,sans-serif,helvetica neue,arial,apple color emoji,segoe ui emoji,segoe ui symbol,noto color emoji; font-size:16px\">We have already established ourselves as a trusted and reliable partner in the industry, and we are always open to working on new development projects and partnerships. We have a large team of dedicated professionals and a full range of logistics support, with offices in Dhaka and Chattagram, as well as a warehouse in Gazipur. </span></p>\r\n\r\n<p><span style=\"font-family:söhne,ui-sans-serif,system-ui,-apple-system,segoe ui,roboto,ubuntu,cantarell,noto sans,sans-serif,helvetica neue,arial,apple color emoji,segoe ui emoji,segoe ui symbol,noto color emoji; font-size:16px\">We believe that by working together, we can grow and achieve sustainability in the industry. If you have any questions or feedback, our team is always available to help.</span></p>\";s:17:\"our_mission_image\";s:12:\"mission1.jpg\";s:11:\"our_mission\";s:717:\"<p><span style=\"font-family:söhne,ui-sans-serif,system-ui,-apple-system,segoe ui,roboto,ubuntu,cantarell,noto sans,sans-serif,helvetica neue,arial,apple color emoji,segoe ui emoji,segoe ui symbol,noto color emoji; font-size:16px\">Eco Colour Chem is committed to providing sustainable and eco-friendly products to the textile industry, while upholding the highest standards of quality and customer service. We strive to be a trusted and reliable partner in the industry, and we are dedicated to innovation and continuous improvement through research and development. Our mission is to support the textile industry in its efforts towards sustainability, and to grow and succeed together in this shared goal.</span></p>\";s:16:\"our_vision_image\";s:13:\"vission_1.jpg\";s:10:\"our_vision\";s:794:\"<p><span style=\"font-family:söhne,ui-sans-serif,system-ui,-apple-system,segoe ui,roboto,ubuntu,cantarell,noto sans,sans-serif,helvetica neue,arial,apple color emoji,segoe ui emoji,segoe ui symbol,noto color emoji; font-size:16px\">Eco Colour Chem&#39;s vision is to be a leading provider of sustainable and eco-friendly products to the textile industry, known for our commitment to quality, customer service, and innovation. We strive to be a trusted partner and thought leader in the industry, and to play a significant role in driving sustainability efforts within the textile industry. Our vision is to create a positive impact on the world through our products and services, and to be a company that is respected and valued by our customers, employees, and the broader community.</span></p>\";s:15:\"about_seo_title\";s:15:\"ECO COLOUR CHEM\";s:19:\"about_meta_keywords\";s:40:\"Textile Chemicals Supplier in Bangladesh\";s:22:\"about_meta_description\";s:105:\"Eco Colour Chem, We believe in quality and with the good quality customer can get their best achievement.\";}', 1, 9, 1, 2, NULL, '2024-01-27 09:22:12'),
