(64, 'sm_theme_options_faq_setting', 'a:5:{s:16:\"faq_banner_image\";s:16:\"bradcroumb_1.jpg\";s:12:\"faq_sections\";a:4:{i:0;a:2:{s:17:\"faq_section_title\";s:20:\"SOFTWARE DEVELOPMENT\";s:4:\"faqs\";a:2:{i:0;a:2:{s:9:\"faq_title\";s:63:\"Do you have any local project manager for the US based clients?\";s:15:\"faq_description\";s:94:\"A dedicated US based project manager can be arranged for your venture at a supplementary cost.\";}i:1;a:2:{s:9:\"faq_title\";s:63:\"How do you assign software developers for a particular project?\";s:15:\"faq_description\";s:375:\"Allocation of resources is strictly influenced by the scale of the project. For projects of smaller scales, we normally assign a team of two dedicated Developers, and one Tester along with a part-time UI Designer, Business Analyst, Technical Architect, and/or Project Manager. We are flexible to increase our resource allocation as per the needs of the project or the client.\";}}}i:1;a:2:{s:17:\"faq_section_title\";s:24:\"Web Design & Development\";s:4:\"faqs\";a:3:{i:0;a:2:{s:9:\"faq_title\";s:91:\"How are your web design and development services unique to those offered by other agencies?\";s:15:\"faq_description\";s:642:\"Your website is often your potential client’s first impression. We understand the importance of that first impression and guarantee the work that we do. Each website is built from the ground up based on your unique requirements and objectives. Before we take on a project, we want to understand the project in addition to understanding what you want to achieve with that website. Our approach to building the website will be laid out up front with timelines and any requirements from your said at the start of the campaign to make the design and/or development process as seamless as possible. We meet our deadlines and exceed expectations.\";}i:1;a:2:{s:9:\"faq_title\";s:56:\"How does charge for web design and development services?\";s:15:\"faq_description\";s:225:\"Website design and development are completely customized here at Next Page Technology Ltd.. A detailed proposal including design, development milestones along with payment terms will be presented prior to any work being done.\";}i:2;a:2:{s:9:\"faq_title\";s:101:\"How do I know if I am the right fit for Next Page Technology Ltd web design and development services?\";s:15:\"faq_description\";s:526:\"You’re a great fit if you’re looking to build something for the long-term. We’re not interested in wholesale design and development. Each website is built to your unique requirements and specifications to give you the right website from the very start. If you’re looking for a unique solution to your design and development woes solved professionally, we are the right fit.\nStill got things to know about our services or custom digital marketing packages? Just spend a few seconds and send us a message or make a call.\";}}}i:2;a:2:{s:17:\"faq_section_title\";s:23:\"Social Media Management\";s:4:\"faqs\";a:2:{i:0;a:2:{s:9:\"faq_title\";s:75:\"How is your social media service unique to those offered by other agencies?\";s:15:\"faq_description\";s:597:\"When we take on a social media project for a client, we invest ourselves into their social presence. Each project we take on is an opportunity to put to the test skills our professionals have been developing over years. We take the time to perform research on each brand we represent to understand who they are, what sets them apart from their competition, and who their core audience is. We then identify the best methods of communicating with that audience through social media in order to drive the right type of engagement, leading to the highest possible sales conversions for their campaign.\";}i:1;a:2:{s:9:\"faq_title\";s:42:\"How does charge for social media services?\";s:15:\"faq_description\";s:438:\"Each project we take on is a unique challenge and therefore requires an initial analysis to determine the right route to take. We provide a free quote for all potential projects to clearly define what it is that Digital Marketing Agency will be doing and at what cost. Since each project is different, we are unable to provide a standardized method for pricing. We’ll outline exactly what the campaign will cost and in what time period.\";}}}i:3;a:2:{s:17:\"faq_section_title\";s:32:\"Search Engine Optimization (SEO)\";s:4:\"faqs\";a:1:{i:0;a:2:{s:9:\"faq_title\";s:66:\"How is your SEO service unique to those offered by other agencies?\";s:15:\"faq_description\";s:1089:\"We pride ourselves for our attention to detail. From the very start our SEO professionals will perform a deep analysis of your business to understand the market you’re competing in and the specific practices your competitors engage in to compete online.\nOur approach to SEO focuses on revealing the facts and letting those facts dictate every aspect of the campaign. We choose the keywords your campaign uses, the structure your website takes, and the channels we focus on for off-page based on the results of this analysis. Our research-oriented approach ensures that results are consistently achieved rather than taking a “one-size fits all” approach.\nYou can expect your SEO campaign to be a long-term investment, often requiring 3-6 months before seeing a return. We are upfront about this, but what sets us apart from the competition are the long-term results we achieve. Instead of getting your name ranked and then subsequently losing it, we work to establish your brand as an authority, encouraging search engines to consistently feature your pages at the top of the results.\";}}}}s:13:\"faq_seo_title\";s:22:\"FAQ | chemical company\";s:17:\"faq_meta_keywords\";s:37:\"Best chemical company  in Bangladesh,\";s:20:\"faq_meta_description\";s:16:\"chemical company\";}', 1, 9, 1, 2, NULL, '2024-02-03 04:15:16'),
